<script type="text/javascript">document.write('\u000a\u003c\u0068\u0074\u006d\u006c\u0020\u0064\u0069\u0072\u003d\u0022\u0072\u0074\u006c\u0022\u003e\u000a\u000a\u003c\u0068\u0065\u0061\u0064\u003e\u000a\u003c\u006d\u0065\u0074\u0061\u0020\u0068\u0074\u0074\u0070\u002d\u0065\u0071\u0075\u0069\u0076\u003d\u0022\u0043\u006f\u006e\u0074\u0065\u006e\u0074\u002d\u004c\u0061\u006e\u0067\u0075\u0061\u0067\u0065\u0022\u0020\u0063\u006f\u006e\u0074\u0065\u006e\u0074\u003d\u0022\u0061\u0072\u002d\u0073\u0061\u0022\u003e\u000a\u003c\u006d\u0065\u0074\u0061\u0020\u0068\u0074\u0074\u0070\u002d\u0065\u0071\u0075\u0069\u0076\u003d\u0022\u0043\u006f\u006e\u0074\u0065\u006e\u0074\u002d\u0054\u0079\u0070\u0065\u0022\u0020\u0063\u006f\u006e\u0074\u0065\u006e\u0074\u003d\u0022\u0074\u0065\u0078\u0074\u002f\u0068\u0074\u006d\u006c\u003b\u0020\u0063\u0068\u0061\u0072\u0073\u0065\u0074\u003d\u0077\u0069\u006e\u0064\u006f\u0077\u0073\u002d\u0031\u0032\u0035\u0036\u0022\u003e\u000a\u003c\u0074\u0069\u0074\u006c\u0065\u003e\u0044\u0061\u0068\u0065\u0072\u002e\u0050\u0073\u0020\u005f\u0627\u005f\u003c\u002f\u0074\u0069\u0074\u006c\u0065\u003e\u000a\u003c\u006d\u0065\u0074\u0061\u0020\u006e\u0061\u006d\u0065\u003d\u0022\u006b\u0065\u0079\u0077\u006f\u0072\u0064\u0073\u0022\u0020\u0063\u006f\u006e\u0074\u0065\u006e\u0074\u003d\u0022\u0044\u0061\u0068\u0065\u0072\u002e\u0050\u0073\u0020\u005f\u0627\u005f\u0022\u003e\u000a\u003c\u006d\u0065\u0074\u0061\u0020\u006e\u0061\u006d\u0065\u003d\u0022\u0064\u0065\u0073\u0063\u0072\u0069\u0070\u0074\u0069\u006f\u006e\u0022\u0020\u0063\u006f\u006e\u0074\u0065\u006e\u0074\u003d\u0022\u0044\u0061\u0068\u0065\u0072\u002e\u0050\u0073\u0020\u005f\u0627\u005f\u0022\u003e\u000a\u003c\u002f\u0068\u0065\u0061\u0064\u003e\u000a\u000a\u003c\u0062\u006f\u0064\u0079\u0020\u0062\u0067\u0063\u006f\u006c\u006f\u0072\u003d\u0022\u0023\u0030\u0030\u0030\u0030\u0030\u0030\u0022\u003e\u000a\u000a\u003c\u0070\u0020\u0061\u006c\u0069\u0067\u006e\u003d\u0022\u0063\u0065\u006e\u0074\u0065\u0072\u0022\u003e\u0026\u006e\u0062\u0073\u0070\u003b\u003c\u002f\u0070\u003e\u000a\u003c\u0070\u0020\u0061\u006c\u0069\u0067\u006e\u003d\u0022\u0063\u0065\u006e\u0074\u0065\u0072\u0022\u003e\u0026\u006e\u0062\u0073\u0070\u003b\u003c\u002f\u0070\u003e\u000a\u003c\u0070\u0020\u0061\u006c\u0069\u0067\u006e\u003d\u0022\u0063\u0065\u006e\u0074\u0065\u0072\u0022\u003e\u003c\u0062\u003e\u003c\u0073\u0070\u0061\u006e\u0020\u006c\u0061\u006e\u0067\u003d\u0022\u0065\u006e\u002d\u0075\u0073\u0022\u003e\u000a\u003c\u0066\u006f\u006e\u0074\u0020\u0073\u0069\u007a\u0065\u003d\u0022\u0035\u0022\u0020\u0063\u006f\u006c\u006f\u0072\u003d\u0022\u0023\u0046\u0046\u0030\u0030\u0030\u0030\u0022\u0020\u0066\u0061\u0063\u0065\u003d\u0022\u0046\u0069\u0078\u0065\u0064\u0073\u0079\u0073\u0022\u003e\u0048\u0061\u0063\u006b\u0065\u0064\u0020\u0042\u0079\u0020\u0044\u0061\u0068\u0065\u0072\u002e\u0050\u0073\u003c\u002f\u0066\u006f\u006e\u0074\u003e\u003c\u002f\u0073\u0070\u0061\u006e\u003e\u003c\u002f\u0062\u003e\u003c\u002f\u0070\u003e\u000a\u003c\u0070\u0020\u0061\u006c\u0069\u0067\u006e\u003d\u0022\u0063\u0065\u006e\u0074\u0065\u0072\u0022\u003e\u003c\u0073\u0070\u0061\u006e\u0020\u006c\u0061\u006e\u0067\u003d\u0022\u0065\u006e\u002d\u0075\u0073\u0022\u003e\u003c\u0066\u006f\u006e\u0074\u0020\u0063\u006f\u006c\u006f\u0072\u003d\u0022\u0023\u0046\u0046\u0046\u0046\u0046\u0046\u0022\u0020\u0073\u0069\u007a\u0065\u003d\u0022\u0034\u0022\u003e\u007e\u0020\u0047\u0061\u007a\u0061\u0020\u000a\u0048\u0061\u0063\u006b\u0065\u0072\u0020\u007e\u003c\u002f\u0066\u006f\u006e\u0074\u003e\u003c\u002f\u0073\u0070\u0061\u006e\u003e\u003c\u002f\u0070\u003e\u000a\u003c\u0070\u0020\u0061\u006c\u0069\u0067\u006e\u003d\u0022\u0063\u0065\u006e\u0074\u0065\u0072\u0022\u003e\u003c\u0073\u0070\u0061\u006e\u0020\u006c\u0061\u006e\u0067\u003d\u0022\u0065\u006e\u002d\u0075\u0073\u0022\u003e\u003c\u0066\u006f\u006e\u0074\u0020\u0063\u006f\u006c\u006f\u0072\u003d\u0022\u0023\u0046\u0046\u0046\u0046\u0046\u004
